@use '../base' as *;

.footer {
    padding: 3em 0;
    background-color: var(--clr-lightest-green);
    display: grid;
    gap: 2.5rem;

    &__logo {
        margin-inline: auto;
        width: 150px;
        filter: invert(32%) sepia(92%) saturate(289%) hue-rotate(118deg) brightness(45%) contrast(85%);
    }

    .socials-list {
        display: flex;
        justify-content: center;
        margin-top: 2rem;
    }

    .social__item {
        cursor: pointer;

        &:hover {
            filter: invert(100%) sepia(93%) saturate(100%) hue-rotate(23deg) brightness(1000%) contrast(1000%);
        }
    }

    .social__item+.social__item {
        margin-left: 1.5rem;
    }

    .nav__list {
        display: flex;
        justify-content: space-around;

        @media(min-width: 800px) {
            justify-content: center;
        }
    }

    .nav__item {
        margin-top: 0;
        color: var(--clr-light-green);

        &:hover {
            color: #fff;
        }
    }
}

